      "Show found search result": "<div id=\"SearchByEmail-react\"\n  class=\"text-center\">\n  <form><input type=\"text\"\n      placeholder=\"by email\"\n      value=\"tu@pr.com\"><input class=\"btn btn-primary\"\n      type=\"submit\"\n      value=\"search\"></form>\n  <p class=\"lead\">Found Tu Nguyen, email: tu@pr.com</p>\n  <div id=\"CrudConnectionControlPanel-react\"><button class=\"btn btn-success\"\n      id=\"createConnectionBtn\">Invite Tu Nguyen</button></div>\n</div>"
